document.addEventListener("DOMContentLoaded", function () {
    window.cy = cytoscape({
        container          : document.getElementById("cy"),
        layout             : {name: "preset"},
        selectionType      : "single",
        boxSelectionEnabled: false,
        pixelRatio         : 1,
        hideEdgesOnViewport: true,
        textureOnViewport  : true,
        elements           : DATA,
        style              : [
            {selector: "node", style: {"font-size": "11px", "font-weight": 700, "text-valign": "center", "color": "#000"}},
            {selector: "node[t='__VIRUS__']", style: {width: 24, height: 24, "background-color": "#d8334a", label: "data(l)"}},
            {selector: "node[t='__AD__']", style: {width: 24, height: 24, "background-color": "#967adc", label: "data(l)"}},
            {selector: "node[t='GENE_OVERLAP']", style: {width: 10, height: 10, "font-size": "7px", "background-color": "#fc6e51"}},
            {selector: "node[t='GENE_AD']", style: {width: 10, height: 10, "font-size": "7px", "background-color": "#2ecc71"}},
            {selector: "node[t='GENE_COV']", style: {width: 10, height: 10, "font-size": "7px", "background-color": "#3fbbe8"}},
            {selector: "node[t='GENE_OVERLAP_']", style: {width: 10, height: 10, "font-size": "7px", "background-color": "#fc6e51", label: "data(l)"}},
            {selector: "node[t='GENE_AD_']", style: {width: 10, height: 10, "font-size": "7px", "background-color": "#2ecc71", label: "data(l)"}},
            {selector: "node[t='GENE_COV_']", style: {width: 10, height: 10, "font-size": "7px", "background-color": "#3fbbe8", label: "data(l)"}},
            {selector: "node:selected", style: {"border-width": "4px", "border-color": "#3bf"}},
            {selector: "edge", style: {width: 1, "line-color": "#ccc", opacity: 0.2}},
            {selector: "edge.label", style: {"line-color": "#3bf", "opacity": 0.8}},
            {selector: 'node.label', style: {label: "data(l)", "border-width": "2px", "border-color": "#3bf"}},
        ],
    });
    window.cy.fit();
    window.cy.on("select", "node", function (evt) {
        var node = evt.target;
        node.addClass("label");
        node.neighborhood().addClass("label");
        node.connectedEdges().addClass("label");
    });
    window.cy.on("unselect", "node", function (evt) {
        var node = evt.target;
        node.removeClass("label");
        node.neighborhood().removeClass("label");
        node.connectedEdges().removeClass("label");
    });
    document.getElementById("cover").style.display = "none";
});
